                    </ul>
                </div>

                {/* --------- Right Side -------- */}


            {/* ================================= */}
            {/* ========== B O T T O M ========== */}
            <hr></hr>
            <div id={styles.bottom}>
                <span><p>Made With<span><i className="fas fa-heart"></i></span>By Alexander</p></span>
                <span>Â© 2019 Alexander Augustin. All rights reserved</span>
            </div>
        </footer>
    )
}

export default footer;
